    def onclicked(self):
        global __data_columns
        global __model

        location=self.comboBox.currentText()
        area=self.textline_1.text() 
        bath=self.textline_2.text()
        bhk=self.textline_3.text()   
        
        if area:
            area=float(self.textline_1.text())
        else:
            QtWidgets.QMessageBox.warning(self.centralwidget,"Warning","Enter AREA(Sq.Ft)",QtWidgets.QMessageBox.Ok)
        

        if bath:
             bath=float(self.textline_2.text())
        else:
            QtWidgets.QMessageBox.warning(self.centralwidget,"Warning","Enter BHK",QtWidgets.QMessageBox.Ok)
        

        if bhk:
             bhk=float(self.textline_3.text())
        else:
            QtWidgets.QMessageBox.warning(self.centralwidget,"Warning","Enter BATH",QtWidgets.QMessageBox.Ok)
        

        

        

        with open("/home/ameen/python/ml training/house_price_prediction_project/app/lr-model.pickle","rb") as f:
            __model=pickle.load(f)

        try:
            loc_index=__data_columns.index(location.lower())
    
        except:
            loc_index=-1

        x=np.zeros(len(__data_columns))
        x[0]=area
        x[1]=bath
        x[2]=bhk
        if loc_index>=0:
            x[loc_index]=1

        out=round(__model.predict([x])[0],2)
        
        self.label_5.setStyleSheet("background-color: white;")
        self.label_5.setText("ESTIMATED PRICE :"+" "+str(out)+" LAKH INR")
        self.label_5.adjustSize()
        
    


